import React from 'react';

const productList = [
  {
    id: 1,
    name: 'Sword Tail',
    quantity: 10,
    price: 500,
    description: 'A healthy and good looking ornamental fish worth the money.',
    imageUrl: 'https://www.petguide.com/wp-content/uploads/2013/11/swordtail-fish.jpg'
  },
  {
    id: 2,
    name: 'Black Dorsal',
    quantity: 15,
    price: 700,
    description: 'A healthy and good looking ornamental fish worth the money.',
    imageUrl: 'https://d3sroz1c0sf1tc.cloudfront.net/catalog/product/cache/41bbdb7f5b3dd2c89286590613e1dee0/h/a/half-black-guppy-300x300.jpg'
  },
  {
    id: 1,
    name: 'Sword Tail',
    quantity: 10,
    price: 500,
    description: 'A healthy and good looking ornamental fish worth the money.',
    imageUrl: 'https://www.petguide.com/wp-content/uploads/2013/11/swordtail-fish.jpg'
  },
  {
    id: 2,
    name: 'Black Dorsal',
    quantity: 15,
    price: 700,
    description: 'A healthy and good looking ornamental fish worth the money.',
    imageUrl: 'https://d3sroz1c0sf1tc.cloudfront.net/catalog/product/cache/41bbdb7f5b3dd2c89286590613e1dee0/h/a/half-black-guppy-300x300.jpg'
  }
];
const products = () => {
    return (
      <div>
      {/* Header */}
      <nav className="navbar navbar-light bg-light">
        <div className="container-fluid">
          <a className="navbar-brand">DO AQUA FISHES</a>
          <form className="d-flex">
            <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search"/>
            <button className="btn btn-outline-success" type="submit">Search</button>
          </form>
        </div>
      </nav>
      {/* List of products */}
      <h2>Products</h2>
      <div className="row container">
      {
        productList.map((prod, index)=>{
          return(
            <div key={index} className="card" style={{width: "18rem",
            margin: "10px",
    borderRadius: "10px",
    backgroundColor: "cornsilk",
    padding: 0,
            }}>
              <img src={prod.imageUrl} className="card-img-top" style={{height: "200px", resizeMode: "contain"}} />
              <div className="card-body">
                <h5 className="card-title">{prod.name}</h5>
                <h6 className="card-text">{prod.price}</h6>
                <p className="card-text">{prod.description}</p>
                <p className="card-text">{prod.quantity} stocks left.</p>
                <div className="col" style={{justifyContent: "space-between", margin: ''}}>
                <a href="#" className="btn btn-primary col-6">Edit</a>
                <a href="#" className="btn btn-danger col-6">Delete</a>
                </div>
              </div>
            </div>
          )
        })
      }
      </div>
      </div>

    );
};


export default products;
